import React from 'react'
import babaji from './Images/babaji.jpeg';
import maam from './Images/maam.jpeg';
export default function Article() {

    const articleContent=
    [{imgSrc:babaji, name:"Dr. Rahul (Babaji)",title:"BHMS Banaras",description:"Step into the world of holistic healing guided by Dr. Rahul, a seasoned homeopathic physician and adept astrologer. With a deep-rooted passion for natural remedies and celestial insights, Dr. [Doctor's Name] brings a unique blend of ancient wisdom and modern expertise to his practice. Specializing in personalized homeopathic treatments tailored to individual constitutions, he addresses a myriad of health concerns with precision and care. Moreover, his profound understanding of astrology offers invaluable insights into the cosmic influences shaping one's health and well-being. By harmonizing the principles of homeopathy and astrology, Dr. [Doctor's Name] empowers his patients to embark on a transformative journey towards holistic wellness, unlocking their full potential and embracing a life of vitality and balance."},
    {imgSrc:maam, name:"Dr. Menka",title:"BHMS Banaras",description:"Step into the realm of holistic healing guided by Dr. [Doctor's Name], a dedicated female homeopathic physician and intuitive astrologer. With a nurturing touch and a deep understanding of natural remedies, Dr. [Doctor's Name] offers personalized care that addresses the root causes of illness and promotes overall well-being. Her expertise in homeopathy is complemented by her intuitive insights into astrology, allowing her to provide comprehensive and holistic treatments that align with the unique needs of each individual. Dr. [Doctor's Name] empowers her patients to embrace their innate healing abilities and embark on a journey towards optimal health and vitality. With compassion and wisdom, she creates a nurturing environment where patients can experience profound healing and transformation."}];

    const renderCard=(content,index)=>
    {
        return(
        <div key={index} className="card article border-0 col-6">
            <img className="docimage pt-3" src={content.imgSrc} alt="doc pic" height="300px" width="300px"/>
            <h3 className="pt-3">{content.name}</h3>
            <p className="p-0">{content.title}</p>
            <p className="p-xl-0 px-4">{content.description}</p>
        </div>);
    }

  return (
    <div id="doc">
        <div className="headers pb-4">Our Doctors</div>
       <div className="articleHead row"> 
          {articleContent.map((content,index)=>(renderCard(content,index)))}
        </div>
    </div>
  );

  }
